def rotate_left(lst, n):
    n = n % len(lst)  # To handle cases where n is greater than the list size
    for i in range(n):
        first_element = lst[0]
        for j in range(len(lst) - 1):
            lst[j] = lst[j + 1]
        lst[-1] = first_element
    return lst
